import React from 'react';
import "./Nav.css";
import { NavLink } from "react-router-dom"
import CheckIcon from '@material-ui/icons/Check';
import CheckCircleOutlineOutlinedIcon from '@material-ui/icons/CheckCircleOutlineOutlined';

function Nav() {
    return (
        <div className="nav">
            <NavLink to="/" exact activeClassName="active" >  <p className="nav_personal single" >
                <CheckIcon className="nav-btn" />
                Personal Details</p></NavLink>
                <svg height="210" width="500">
                <line x1="100" y1="0" x2="310" y2="0" style={{stroke:"rgb(255,250,0)",strokeWidth:2}} />
</svg>

            <NavLink to="/companydetails" activeClassName="active">  <p className="nav_company single" >
                <CheckCircleOutlineOutlinedIcon  className="nav-btn"/>
                Company Details</p></NavLink>
            <NavLink to="/emailverification" activeClassName="active"> <p className="nav_email single" >Email Verification</p></NavLink>
          
        
           
        </div>
    )
}

export default Nav
